import React from "react";
import image from "../img.png";
import "bootstrap/dist/css/bootstrap.min.css";
import {Link} from "react-router-dom";

function Home() {
  return (

    <div class="container-fluid">
    <img className="home-img" src={image} alt="food"/>
    <div class="row">
    <div class="col-md-10 col-lg-10 home-bar">
    <h1 className="heading-home home">Uber <span className="heading-eats">Eats</span></h1>
    </div>
    <div class="col-md-2 col-lg-2 home-bar">
    <Link to="./CustomerLogin.jsx">
    <button type="button" class="home btn btn-dark btn-lg">Sign In</button>
    </Link>
    </div>
    </div>
    <div class="row">
    <div class="col-md col-lg home-bar">
      <h3 className="para-home home">We've got your cravings covered!</h3>
    </div>
    </div>
    </div>

  );
}

export default Home;
